import React, { Fragment } from 'react';
//import Tarea from './Tarea';

const ListadoTareas = () => {

    return (
        <Fragment>
        <div className="col-md-4 mb-3">
            <div className="">
                <button type="button" className="btn btn-primary">Administrar</button>
                <button type="button" className="btn btn-primary">Organizacion</button>
                <button type="button" className="btn btn-primary">Plantel</button>
            </div>
        </div>
        <div className="col-md-4 mb-3">
            <div className="">
                <button type="button" className="btn btn-primary" font="weight-bold">Entrenamientos</button>
                <button type="button" className="btn btn-primary">Partidos</button>
                <button type="button" className="btn btn-primary">Rivales</button>
            </div>
        </div>
        <div className="col-md-4 mb-3">
            <div className="">
                <button type="button" className="btn btn-primary">Sugerir</button>
                <button type="button" className="btn btn-primary">Reportes</button>
                <button type="button" className="btn btn-primary">Respaldo</button>
            </div>
        </div>
    </Fragment>
        
    );
}
export default ListadoTareas;
